import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Register from './components/Register'; // Adjust path as necessary
import Login from './components/Login'; // Adjust path as necessary
import Contacts from './components/Contacts'; // Adjust path as necessary
import Navigation from './components/Navigation'; // If you have a navigation component

function App() {
  return (
    <>
      <Navigation /> {/* Include navigation if available */}
      <Switch>
        <Route path="/register" component={Register} />
        <Route path="/login" component={Login} />
        <Route path="/contacts" component={Contacts} />
        {/* Redirect to default route or include a 404 page */}
      </Switch>
    </>
  );
}

export default App;
